// Reports.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { ReportService } from '../../services/reportService';
import { useLanguage } from '../../context/LanguageContext';
import '../../styles/reports.css';

const Reports = () => {
  const navigate = useNavigate();
  const { currentLanguage, t } = useLanguage();

  const handleGoBack = () => {
    navigate(-1); // ËøîÂõû‰∏ä‰∏ÄÈ°µ
  };

  const [reportType, setReportType] = useState('weekly');
  const [reportData, setReportData] = useState(null);
  const [reportDate, setReportDate] = useState(new Date().toISOString().split('T')[0]);
  const [loading, setLoading] = useState(false);

  const generateReport = () => {
    setLoading(true);
    try {
      const targetDate = new Date(reportDate);
      const report = ReportService.generateComprehensiveReport(reportType, targetDate);
      setReportData(report);
    } catch (error) {
      console.error('ÁîüÊàêÊä•ÂëäÂ§±Ë¥•:', error);
    } finally {
      setLoading(false);
    }
  };

  const downloadReport = () => {
    if (reportData) {
      ReportService.generateAndDownloadReport(reportType);
    }
  };

  // È°µÈù¢Âä†ËΩΩÊó∂ÁîüÊàêÈªòËÆ§Êä•Âëä
  useEffect(() => {
    generateReport();
  }, []);

  // ÂΩìÊä•ÂëäÁ±ªÂûãÊàñÊó•ÊúüÊîπÂèòÊó∂Ëá™Âä®ÈáçÊñ∞ÁîüÊàêÊä•Âëä
  useEffect(() => {
    if (reportData) { // Âè™ÊúâÂú®Â∑≤ÁªèÊúâÊä•ÂëäÊï∞ÊçÆÊó∂ÊâçËá™Âä®ÈáçÊñ∞ÁîüÊàê
      generateReport();
    }
  }, [reportType, reportDate]);

  return (
    <div className="admin-page">
      <div className="page-header">
        <div className="page-nav">
          <button 
            className="btn btn-back"
            onClick={handleGoBack}
            title={t('common.back') || 'ËøîÂõû'}
          >
            <span className="btn-icon">‚Üê</span>
            {t('common.back') || 'ËøîÂõû'}
          </button>
        </div>
        <h1 className="page-title">
          {t.reports || 'Êï∞ÊçÆÊä•Âëä'} - {
            reportType === 'daily' ? (t.dailyReport || 'Êó•Êä•') :
            reportType === 'weekly' ? (t.weeklyReport || 'Âë®Êä•') :
            (t.monthlyReport || 'ÊúàÊä•')
          }
        </h1>
        <p className="page-subtitle">{t.systemDataAnalysis || 'Á≥ªÁªüËøêË°åÊï∞ÊçÆÁªüËÆ°‰∏éÂàÜÊûê'}</p>
      </div>

      <div className="card">
        <div className="card-header">
          <h3 className="card-title">{t.reportConfiguration || 'Êä•ÂëäÈÖçÁΩÆ'}</h3>
        </div>
        <div className="card-body">
          <div className="form-row">
            <div className="form-group">
              <label className="form-label">{t.reportType || 'Êä•ÂëäÁ±ªÂûã'}</label>
              <select 
                className="form-select"
                value={reportType} 
                onChange={(e) => setReportType(e.target.value)}
              >
                <option value="daily">{t.dailyReport || 'Êó•Êä•'}</option>
                <option value="weekly">{t.weeklyReport || 'Âë®Êä•'}</option>
                <option value="monthly">{t.monthlyReport || 'ÊúàÊä•'}</option>
              </select>
            </div>
            <div className="form-group">
              <label className="form-label">{t.dateRange || 'Êó∂Èó¥ËåÉÂõ¥'}</label>
              <input 
                type="date" 
                className="form-input" 
                value={reportDate}
                onChange={(e) => setReportDate(e.target.value)}
              />
            </div>
            <div className="form-group">
              <button 
                className="btn btn-primary" 
                onClick={generateReport}
                disabled={loading}
              >
                <span className="btn-icon">üìä</span>
                {loading ? (t.generating || 'ÁîüÊàê‰∏≠...') : (t.generateReport || 'ÁîüÊàêÊä•Âëä')}
              </button>
              {reportData && (
                <button 
                  className="btn btn-secondary ml-2" 
                  onClick={downloadReport}
                >
                  <span className="btn-icon">üíæ</span>
                  {t.downloadReport || '‰∏ãËΩΩÊä•Âëä'}
                </button>
              )}
            </div>
          </div>
        </div>
      </div>

      {reportData && (
        <>
          <div className="card">
            <div className="card-body">
              <div className="report-info">
                <div className="report-period">
                  <strong>{t.reportPeriod || 'Êä•ÂëäÂë®Êúü'}:</strong> {reportData.dateRange}
                </div>
                <div className="report-generated">
                  <strong>{t.generatedAt || 'ÁîüÊàêÊó∂Èó¥'}:</strong> {new Date().toLocaleString()}
                </div>
              </div>
            </div>
          </div>
          
          <div className="stats-grid">
          <div className="stat-card primary">
            <div className="stat-header">
              <div className="stat-info">
                <div className="stat-title">{t.totalMatches || 'ÊÄªÂåπÈÖçÊï∞'}</div>
                <div className="stat-value">{reportData.totalMatches}</div>
              </div>
              <div className="stat-icon primary">ü§ù</div>
            </div>
            <div className={`stat-change ${reportData.trends.matchGrowth >= 0 ? 'up' : 'down'}`}>
              {reportData.trends.matchGrowth >= 0 ? '‚Üó' : '‚Üò'} 
              {reportType === 'daily' ? (t.dailyGrowth || 'ËæÉÊò®Êó•') : 
               reportType === 'weekly' ? (t.weeklyGrowth || 'ËæÉ‰∏äÂë®') : 
               (t.monthlyGrowth || 'ËæÉ‰∏äÊúà')} 
              {reportData.trends.matchGrowth >= 0 ? (t.growth || 'Â¢ûÈïø') : (t.decrease || '‰∏ãÈôç')} {Math.abs(reportData.trends.matchGrowth)}%
            </div>
          </div>

          <div className="stat-card success">
            <div className="stat-header">
              <div className="stat-info">
                <div className="stat-title">{t.newUsers || 'Êñ∞Ê≥®ÂÜåÁî®Êà∑'}</div>
                <div className="stat-value">{reportData.newUsers}</div>
              </div>
              <div className="stat-icon success">üë•</div>
            </div>
            <div className={`stat-change ${reportData.trends.userGrowth >= 0 ? 'up' : 'down'}`}>
              {reportData.trends.userGrowth >= 0 ? '‚Üó' : '‚Üò'} 
              {reportType === 'daily' ? (t.dailyGrowth || 'ËæÉÊò®Êó•') : 
               reportType === 'weekly' ? (t.weeklyGrowth || 'ËæÉ‰∏äÂë®') : 
               (t.monthlyGrowth || 'ËæÉ‰∏äÊúà')} 
              {reportData.trends.userGrowth >= 0 ? (t.growth || 'Â¢ûÈïø') : (t.decrease || '‰∏ãÈôç')} {Math.abs(reportData.trends.userGrowth)}%
            </div>
          </div>

          <div className="stat-card warning">
            <div className="stat-header">
              <div className="stat-info">
                <div className="stat-title">{t.activeRequests || 'Ê¥ªË∑ÉËØ∑Ê±Ç'}</div>
                <div className="stat-value">{reportData.activeRequests}</div>
              </div>
              <div className="stat-icon warning">üìã</div>
            </div>
            <div className="stat-change neutral">
              {t.currentActive || 'ÂΩìÂâçÊ¥ªË∑É'}
            </div>
          </div>

          <div className="stat-card info">
            <div className="stat-header">
              <div className="stat-info">
                <div className="stat-title">{t.completionRate || 'ÂÆåÊàêÁéá'}</div>
                <div className="stat-value">{reportData.completionRate}</div>
              </div>
              <div className="stat-icon info">‚úÖ</div>
            </div>
            <div className="stat-change neutral">
              {t.periodCompletion || 'Âë®ÊúüÂÆåÊàêÁéá'}
            </div>
          </div>
        </div>
        </>
      )}

      {reportData && reportData.details && (
        <>
          <div className="card">
            <div className="card-header">
              <h3 className="card-title">{t.categoryBreakdown || 'ÂàÜÁ±ªÁªüËÆ°'}</h3>
            </div>
            <div className="card-body">
              <div className="category-stats">
                {Object.entries(reportData.details.categoryBreakdown).map(([categoryId, data]) => (
                  <div key={categoryId} className="category-stat-item">
                    <div className="category-info">
                      <span className="category-name">{data.name}</span>
                      <span className="category-count">{data.count} {t.requests || 'ËØ∑Ê±Ç'}</span>
                    </div>
                    <div className="category-progress">
                      <div 
                        className="progress-bar"
                        style={{ 
                          width: `${data.count > 0 ? (data.matched / data.count) * 100 : 0}%`
                        }}
                      ></div>
                    </div>
                    <span className="match-rate">
                      {data.count > 0 ? Math.round((data.matched / data.count) * 100) : 0}% {t.matched || 'Â∑≤ÂåπÈÖç'}
                    </span>
                  </div>
                ))}
              </div>
            </div>
          </div>

          {reportData.details.topPerformers && reportData.details.topPerformers.length > 0 && (
            <div className="card">
              <div className="card-header">
                <h3 className="card-title">{t.topPerformers || '‰ºòÁßÄÂøóÊÑøËÄÖ'}</h3>
              </div>
              <div className="card-body">
                <div className="performers-list">
                  {reportData.details.topPerformers.map((performer, index) => (
                    <div key={performer.name} className="performer-item">
                      <div className="performer-rank">#{index + 1}</div>
                      <div className="performer-info">
                        <div className="performer-name">{performer.name}</div>
                        <div className="performer-stats">
                          {performer.matches} {t.matches || 'Ê¨°ÂåπÈÖç'} ‚Ä¢ 
                          {performer.categories.length} {t.categories || '‰∏™ÂàÜÁ±ª'}
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}

          <div className="card">
            <div className="card-header">
              <h3 className="card-title">{t.systemInfo || 'Á≥ªÁªü‰ø°ÊÅØ'}</h3>
            </div>
            <div className="card-body">
              <div className="system-info-grid">
                <div className="info-item">
                  <span className="info-label">{t.reportType || 'Êä•ÂëäÁ±ªÂûã'}</span>
                  <span className="info-value">{reportData.reportType}</span>
                </div>
                <div className="info-item">
                  <span className="info-label">{t.dateRange || 'Êó∂Èó¥ËåÉÂõ¥'}</span>
                  <span className="info-value">{reportData.dateRange}</span>
                </div>
                <div className="info-item">
                  <span className="info-label">{t.generatedAt || 'ÁîüÊàêÊó∂Èó¥'}</span>
                  <span className="info-value">
                    {new Date(reportData.generatedAt).toLocaleString(currentLanguage === 'zh' ? 'zh-CN' : 'en-US')}
                  </span>
                </div>
                <div className="info-item">
                  <span className="info-label">{t.totalUsers || 'ÊÄªÁî®Êà∑Êï∞'}</span>
                  <span className="info-value">{reportData.systemInfo.totalUsers}</span>
                </div>
                <div className="info-item">
                  <span className="info-label">{t.totalRequests || 'ÊÄªËØ∑Ê±ÇÊï∞'}</span>
                  <span className="info-value">{reportData.systemInfo.totalRequests}</span>
                </div>
                <div className="info-item">
                  <span className="info-label">{t.systemHealth || 'Á≥ªÁªüÁä∂ÊÄÅ'}</span>
                  <span className="info-value status-good">
                    {reportData.systemInfo.systemHealth === 'good' ? 
                      (t.healthy || 'ËâØÂ•Ω') : 
                      (t.needsAttention || 'ÈúÄË¶ÅÂÖ≥Ê≥®')
                    }
                  </span>
                </div>
              </div>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default Reports;
